import React from "react";
import { motion } from "framer-motion";
import "./card.css";
import AppAnimations from "../../../common/js/animations";

class Card extends React.Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <motion.div
        variant={AppAnimations.slideToRight}
        initial="hidden"
        animate="visible"
        className="homeCard"
      >
        <div className="icon">
          <i className={this.props.icon}></i>
          {/* <i class="fa-regular fa-object-ungroup"></i> */}
        </div>
        <div className="content">
          <h2 className="title">{this.props.title}</h2>
          <h5 className="description">{this.props.description}</h5>
        </div>
      </motion.div>
    );
  }
}
export default Card;
